import React, { useState } from "react";

const Toko = () => {
	const [state, setstate] = useState("toko");
	const handler = () => {
		setstate("giorgi");
	};
	return (
		<div>
			<h1>{state}</h1>
			<button onClick={handler}>click</button>
		</div>
	);
};

export default Toko;
